import React from 'react';
import logo from '../images/logo.svg';
import './Nav.css';
import { Link } from 'react-router-dom';
import { Row, Col } from 'react-bootstrap';

function NavBar() {
  return (
    <nav className='nav-form navbar-light navbar'>
      <Link to='/'>
        <img className='nav-logo nav-brand' src={logo} alt='logo'></img>
      </Link>
    </nav>
  );
}

export default NavBar;
